import React from 'react';

function ShowHeader() {
    return (
        <div class="topnav">
            <a class="active" href="#home">Home</a>
            <a href="#contact">Contact</a>
            <a href="#about">About</a>
            <b class="logo">KIDOZ</b>
        </div>)
}
function ShowTop() {
    return (
        <div class="headertop">
            <a>นักเรียนที่ผู้ปกครองมารับ</a>
        </div>
    )
}

export default ShowHeader;
